import React from "react";

const index = ({ respond }) => {
    let arrayOfItems = Object.values(respond.terms);

    let lists = arrayOfItems.map((i) => {
        const items = i.map((e) => {
            return <li>{e.theory.date}</li>;
        });

        return <ul>{items}</ul>;
    });
    return <div>{lists}</div>;
};

index.getInitialProps = async (ctx) => {
    const res = await fetch(
        "https://info-car.pl/services/word/ajax/getSchedule?wordId=48&examCategory=B&month=2020-07&_=1591808799610"
    );
    const json = await res.json();
    console.log(json);
    return { respond: json };
};
export default index;
